import React, { useDebugValue } from "react";
import {CrecheUserx} from '../../../data';

import CrecheCard from "./CrecheCard";

 const CrecheSlider2 = () => { 
 
const filteredItems = CrecheUserx.filter(item => item.name === 'Creche2');
  
      return ( 
      <div className="w-full grid xs:grid-cols-2 ">
             {filteredItems.map(item => (
     
     <CrecheCard name={item.name} Location={item.Location} Description={item.Description}  />
   ))}
      </div>
            

          );
        };

 export default CrecheSlider2;
